import React from 'react'
import { Modal, Form } from 'antd'
import CreateForm from './_form'

const create = ({ addModalVisible, addItem, cancelAddModal, addItemLoading }) => {
  const initialValues = {
    firstname: '',
    middlename: '',
    lastname: '',
    username: '',
    email: '',
    idnumber: '',
    mobile: '',
    dateofbirth: '',
    gender: '',
  }
  // eslint-disable-next-line react-hooks/rules-of-hooks
  const [form] = Form.useForm()

  return (
    <Modal
      title="Add User"
      visible={addModalVisible}
      onCancel={cancelAddModal}
      okText="Save"
      confirmLoading={addItemLoading}
      onOk={() => {
        form
          .validateFields()
          .then(values => addItem(values, form))
          .catch(err => console.log(err))
      }}
    >
      <CreateForm initialValues={initialValues} form={form} />
    </Modal>
  )
}

export default create
